;; **
;;; ### Infcomp
;;; 
;;; First, run the inference server from torch-infcomp:
;;; 
;;; `python -m infcomp.infer`
;;; 
;;; Then run the query, specifying number of particles:
;; **

;; @@
(def num-particles 10)
(def csis-states (take num-particles (infer :csis pdfa [test-observations-str alphabet] :observe-embedder-input test-observations)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;pdfa/csis-states</span>","value":"#'pdfa/csis-states"}
;; <=

;; @@
(sample* (categorical (vec (empirical-distribution (collect-results csis-states)))))
